ensive learning materials and expert instruction by a Native Spanish Teacher.\n\nReady to start speaking Spanish? It all starts with understanding the essence of the language and using it in real-life situations right from the start. Say goodbye to memorizing isolated phrases - we focus on immersing you in the language and culture to truly Thrive in Spanish. \n \n üí´ Check out our First 4 Syllabus week:\nWeek 1: Daily Routines\nWeek 2: A Visit to the Doctor\nWeek 3: At the Airport\nWeek 4: Booking Accommodations",

      "description": "Learn Spanish and speak in since the first class with Our 12-Week Course!\nIn just 12 weeks, you'll embark on an exciting journey to master the Spanish language. \n\nOur course includes:\n\n‚û°Ô∏è 12 live, interactive 60-minute classes every week, led by experienced professionals who are passionate about helping you succeed.\n‚û°Ô∏è 6 personalized 30-minute one-to-one sessions, tailored to your schedule! Book when you get your package!\n‚û°Ô∏è Comprehensive study materials to reinforce your learning between classes, including weekly videos with transcriptions, vocabulary lists, engaging games, and more.\n\nDon't let your progress stall - our course is designed to keep your Spanish skills sharp between classes, ensuring that you retain and build on what you've learned. üòé\n\nü§© This course is perfect for you if:\n\n‚û°Ô∏è You're a complete beginner in Spanish, with only a basic knowledge of numbers and the alphabet.\n‚û°Ô∏è You're eager to understand the logic and structure of the language.\n‚û°Ô∏è You're looking for a structured and comprehensive approach to learning Spanish.\n‚û°Ô∏è You want to speak with Native Spanish Speakers using the real slang and the way we talk in Mexico and Latin America.\n\nJoin us today and unlock the world of opportunities that fluency in Spanish can offer. Your journey to Spanish fluency begins this 2024!",

      "appId": "13d21c63-b5ec-5912-8397-c3a5ddb27a97",
      "type": "COURSE",
      "sortOrder": 140,
      "name": "Fluency in Spanish - Subjunctive",
      "description": "Are you ready to take your Spanish from good to extraordinary? Join us for an immersive 6-week journey into the heart of Mexican Spanish with our course, \"Unlock the Magic of Mexican Spanish.\" This program is designed to help you master the subjunctive mood - the secret ingredient that will make you sound like a true native speaker.\n\nüåü Why This Course?\nThe subjunctive mood is the key to expressing yourself with the nuance and flair of a native Spanish speaker. It's the difference between sounding like a textbook and sounding like you've lived in Latin America your whole life. Yet, it's one of the most challenging aspects of Spanish for non-native speakers to master.\nIn just 6 weeks, you'll go from struggling with the subjunctive to using it effortlessly in your everyday Spanish conversations.\n\nüåü What You'll Learn\nEach week, we'll focus on a different aspect of the subjunctive, all within the rich context of Mexican culture:\n\n‚úÖExpress Wishes and Emotions Like a Native\n‚úÖInfluence and Persuade with Ease\n‚úÖNavigate Time Travel and Conversations\n‚úÖDescribe Your Ideal World\n‚úÖChannel Your Inner Telenovela Star\n‚úÖ Gain more confidence and surprise your friends\n\nüåü Course Features\n1. 1-60 min live group class each week for 6 weeks\n2. 4-60 min bonus conversation club classes for the duration of the course.\n3. Small group sizes (max 6 students) for personalized attention\n4. Native Spanish instructors\n5. Cultural immersion through authentic materials (songs, videos, texts)\n6. Interactive exercises between classes\n7. Access to our exclusive digital resource library\n\nWho Is This Course For?\nThis course is perfect for intermediate to advanced Spanish learners who:\n\n- Can hold a conversation in Spanish but want to sound more natural\n- Are planning to travel or move to Latin America\n- Want to understand and enjoy Mexican media without subtitles\n- Are preparing for a Spanish proficiency exam\n- Simply love the Spanish language\n\nüåüBy the End of This Course, You'll Be Able To:\n\n- Express complex ideas, emotions, and hypothetical situations with ease.\n- Understand and use common Mexican expressions that require the subjunctive.\n- Enjoy movies, and music on a deeper level.\n- Impress native speakers with your command of this challenging aspect of Spanish\n\nCan't find your time? Let us know when you can take it here: \nhttps://forms.gle/8KhjFwcGXs68gAkJA\n\nüî• Bonus\nYou get exclusive access to our weekly conversation clubs and digital resource library for the duration of the course. ",
      "tagLine": "Master the subjunctive mood in just 6 weeks and\nlearn to express yourself like a true native Speaker",

      "appId": "13d21c63-b5ec-5912-8397-c3a5ddb27a97",
      "type": "COURSE",
      "sortOrder": 143,
      "name": "Subjunctive Course - Like a Native",
      "description": "Course - Are you ready to take your Spanish from good to extraordinary? Join us for an immersive 6-week journey into the heart of Mexican Spanish with our course, \"Unlock the Magic of Mexican Spanish.\" This program is designed to help you master the subjunctive mood - the secret ingredient that will make you sound like a native speaker.\n\nüåü Why This Course?\nThe subjunctive mood is the key to expressing yourself with the nuance and flair of a native Spanish speaker. It's the difference between sounding like a textbook and sounding like you've lived in Latin America your whole life. Yet, it's one of the most challenging aspects of Spanish for non-native speakers to master.\nIn just 6 weeks, you'll go from struggling with the subjunctive to using it effortlessly in your everyday Spanish conversations.\n\nüåü What You'll Learn\nEach week, we'll focus on a different aspect of the subjunctive, all within the rich context of Mexican culture:\n\n‚úÖExpress Wishes and Emotions Like a Native\n‚úÖInfluence and Persuade with Ease\n‚úÖNavigate Time Travel and Conversations\n‚úÖDescribe Your Ideal World\n‚úÖChannel Your Inner Telenovela Star\n‚úÖ Gain more confidence and surprise your friends\n\nüåü Course Features\n1. 1-60 min live group class each week for 6 weeks\n2. 4-60 min bonus conversation club classes for the duration of the course.\n3. Small group sizes (max 6 students) for personalized attention\n4. Native Spanish instructors\n5. Cultural immersion through authentic materials (songs, videos, texts)\n6. Interactive exercises between classes\n7. Access to our exclusive digital resource library\n\nWho Is This Course For?\nThis course is perfect for intermediate to advanced Spanish learners who:\n\n- Can hold a conversation in Spanish but want to sound more natural\n- Are planning to travel or move to Latin America\n- Want to understand and enjoy Mexican media without subtitles\n- Are preparing for a Spanish proficiency exam\n- Simply love the Spanish language\n\nüåüBy the End of This Course, You'll Be Able To:\n\n- Express complex ideas, emotions, and hypothetical situations with ease.\n- Understand and use common expressions that require the subjunctive.\n- Enjoy movies, and music on a deeper level.\n- Impress native speakers with your command of this challenging aspect of Spanish.\n\nCan't find your time? Let us know when you can take it here: \nhttps://forms.gle/8KhjFwcGXs68gAkJA\n\nüî• Bonus\nYou get exclusive access to our weekly conversation clubs and digital resource library for the duration of the course. ",
      "tagLine": "Master the subjunctive mood in just 6 weeks and\nlearn to express yourself like a true native Speaker",

      "name": "One-to-One Structured Class",
      "description": "Hello! I'm Mildred Camarillo, a language and culture enthusiast bringing 23 years of energy and passion from the vibrant city of Acapulco, Mexico. My background in International Relations allowed me to immerse myself in various cultures, but it was in teaching my native language, Spanish, that I found my true passion. In my classes, I blend grammar with videos, games, and cultural curiosities to make learning dynamic, fun, and immersive. If you're looking to improve your oral and written skills while having fun, my classes are perfect for you!\n\nOutside the classroom, I'm an adventurous language learner, fluent in Spanish, English, and French, and currently learning Portuguese, Korean, and Chinese. With three chihuahuas always by my side, I'm an open and curious person, ready for new experiences and connections. If you're looking for an enthusiastic teacher ready to guide you every step of the way on your learning journey, look no further: click on my profile, and let's get started!",

                const { startDate, endDate } = filter;

                return slots
            },
            async getPlans(planIds) {
                return plans.plans
            }
        };

        const getStaff = async () => {
          return staff.items
        }

        // Mock Wix $w functionality
        const $w = {
            onReady(callback) {
                window.addEventListener('load', callback);
            }
        };

        // Initialize calendar when page loads
        window.addEventListener('load', async function() {
            const calendar = document.querySelector('my-element');
            window.$w = $w;

            // Mock the Wix element selection
            $w.teaching_calendar = calendar;
            
            let calendarData = null;
            let cachedSlots = [];
            const currentDates = {
                start: null,
                end: null,
            };

            const setSlots = (slots) => {
                console.log("setSlots", slots);
                calendar.setAttribute("availability", JSON.stringify(slots));
            };

            const setPlans = (plans) => {
                console.log("plans", plans)
                calendar.setAttribute("plans", JSON.stringify(plans));
            };

            const setStaff = ()=> {
              const staff = getStaff().then(s => calendar.setAttribute("teachers", JSON.stringify(s)));
              
            }

            const setCalendarData = (data) => {
                console.log("data", data)
                calendarData = data;
                calendar.setAttribute("services", JSON.stringify(data.services));
            };

            const refreshCalendarData = async () => {
                const startTimestamp = new Date().getTime();
                calendarData = await mockBackend.getCalendarData();
                setCalendarData(calendarData);
                setStaff();
                const endTimestamp = new Date().getTime();
                console.log(
                    "refreshCalendarData time elapsed",
                    endTimestamp - startTimestamp,
                    "ms"
                );
            };

            const updateSlots = async ({ startDate, endDate }) => {
                const startTimestamp = new Date().getTime();
                console.log("updateSlots", startDate, endDate, currentDates);
                if (
                    currentDates.start <= startDate &&
                    currentDates.end >= startDate &&
                    currentDates.start <= endDate &&
                    currentDates.end >= endDate
                ) {
                    return;
                }
                currentDates.start = startDate;
                currentDates.end = endDate;
                if (!calendarData) {
                    await refreshCalendarData();
                }
                const serviceId = calendarData.services.map((s) => s._id);
                const _slots = await mockBackend.getSlots({
                    filter: {
                        serviceId,
                        bookable: true,
                        startDate,
                        endDate,
                    },
                });

                const endTimestamp = new Date().getTime();
                console.log("updateSlots time elapsed", endTimestamp - startTimestamp, "ms");
                return _slots;
            };

            const setSlotsFromDates = async ({ startDate, endDate }) => {
                const slots = await updateSlots({ startDate, endDate });
                if (!slots) {
                    return;
                }
                setSlots(slots);
            };

            const onCalendarDateSet = async (e) => {
                const { start: startDate, end: endDate } = JSON.parse(e.detail);
                setSlotsFromDates({ startDate, endDate });
            };

            const onGetPlans = async (e) => {
                const planIds = JSON.parse(e.detail);
                const plans = await mockBackend.getPlans(planIds);
                setPlans(plans);
            };

            const initialLoadSlots = async () => {
                const startDate = new Date();
                startDate.setHours(0, 0, 0, 0);
                startDate.setDate(startDate.getDate() - startDate.getDay());
                const endDate = new Date();
                endDate.setHours(0, 0, 0, 0);
                endDate.setDate(endDate.getDate() + 60);
                const startDateString = startDate.toISOString();
                const endDateString = endDate.toISOString();
                setSlotsFromDates({ startDate: startDateString, endDate: endDateString });
            };

            // Set up event listeners
            calendar.addEventListener("dateset", onCalendarDateSet);
            calendar.addEventListener("getPlans", onGetPlans);

            // Initialize
            refreshCalendarData();
            initialLoadSlots();
        });
